function toggleWidget(speed){
  console.log('toggleing');
  if (!widget_active){
    tl.play();
    widget_active = true;
  } else {
    tl.reverse();
    widget_active = false;
  }
}

function showWidget(){
  if (!widget_active){
    tl.play();
    widget_active = true;
  }
}
function hideWidget(){
  if (widget_active){
    tl.reverse();
    widget_active = false;
  }
}
